                    <img className='inline p-4' style={{maxWidth :'120px'}} src='/logo_semana_fsm.png' alt='fsm'/>
                    <img className='inline p-4' style={{maxWidth: '120px'}} src='/logo_devpleno.png' alt='devpleno'/>
                </div>                
            </div>            
        </div>
    )
}

export default Footer
